import React from 'react';
import './App.css';
import Header from './Header';
import Body from './Body';
import Footer from './Footer';

class App extends React.Component{
  render(){
    return (
      <div>
        <Header />
        <div className = "App App-header" >
          <Body />
          <Footer />
        </div>
      </div>
    );
  }
}

export default App;
